let titleList = ["# whoami","# whoami|"]

let i = 0;
let beamStyle = ["none", "block"];
let j = 0;
setInterval(function () {
    document.title = titleList[i];
    i = (i + 1) % titleList.length;
    beam.style.display = beamStyle[i];
    j = (j + 1) % beamStyle.length
}, 500);

var jsInput = null;
var beam = null;
var inputLine = null;
var terminal = null;
addEventListener('load', (event) => {
    jsInput = document.getElementById("jsinput");
    beam = document.getElementById("beam");
    inputLine = document.getElementById("input-line");
    terminal = document.getElementById("terminal");
});

var realCommands = ["help", "whoami", "id", "ls", "clear", "refresh"]
var commandDescriptions = {
    "help": "Displays available commands",
    "whoami": "Displays the current user",
    "id": "Displays the current user's id",
    "ls": "Displays the contents of the current directory",
    "clear": "Clears the terminal",
    "refresh": "Refreshes the page"
}

function handleCommand(command) {


    switch(command) {
        case "help":
            terminal.innerHTML += "<p>Available commands:</p>";
            for (var i = 0; i < realCommands.length; i++) {
                terminal.innerHTML += "<p style=\"color: yellow\">" + realCommands[i] + "</p>";
                terminal.innerHTML += "<p>" + commandDescriptions[realCommands[i]] + "</p>";
                terminal.innerHTML += "<br>";
            }
            break;
        case "whoami":
            terminal.innerHTML += "<p>root</p>";
            break;
        case "id":
            terminal.innerHTML += "<p>uid=0(root) gid=0(root) groups=0(root</p>";
            break;
        case "clear":
            terminal.innerHTML = "";
            break;
        case "refresh":
            location.reload();
            break;
        case "ls":
            terminal.innerHTML += "<p>flag.txt</p>";
            break;
        default:
            terminal.innerHTML += "<p>Unknown command</p>";
            break;
    }   
}   

document.addEventListener('keydown', (event) => {
    var name = event.key;
    if (name.length === 1) {
        jsInput.textContent = jsInput.textContent + name;
    } else if(name === "Backspace") {
        jsInput.textContent = jsInput.textContent.slice(0, -1);
    } else if(name === "Enter") {
        var command = jsInput.textContent;
        inputLine.remove();

        terminal.innerHTML += "<p>root@serv:~# " + command + "</p>";

        handleCommand(command);

        inputLine = document.createElement("div");
        inputLine.id = "input-line";
        inputLine.className = "input-line";
        terminal.appendChild(inputLine);
        inputLine.innerHTML += "<p>root@serv:~#</p>";
        jsInput = document.createElement("p");
        jsInput.id = "jsinput";
        inputLine.appendChild(jsInput);
        beam = document.createElement("div");
        beam.id = "beam";
        beam.className = "beam";
        inputLine.appendChild(beam);
    }
    beam.style.display = "none";
    document.body.scrollIntoView(0)
  }, false);

